import { useEffect } from "react";
import Header from "./Header";
import Main from "./Main";

function App() {

  useEffect(
    function () {
      fetch('http://localhost:9000/questions')
        .then(response => response.json())
        .then(data => console.log(data))
        .catch((error) => console.error("Error"))
    }, []
  )

  return (
    <div className="app">
      <Header />
      <Main>
        <p>1/15</p>
        <p>Questions?</p>
      </Main>
    </div>
  );
}

export default App;
